import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the view toggle controls by label text (Sort by:) and then find the List View button
    await page.waitForSelector('text=Sort by:', { timeout: 5000 });

    // Try to locate the List View button by its icon (fa-list) and aria-label/title
    // Use a combination of button and icon selectors to ensure robustness
    const listViewBtn = await page.$('button.view-btn:has(i.fa-list), button[title="List View"], button:has-text("List")');
    if (!listViewBtn) {
      throw new Error('List View button not found');
    }

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products-list container to appear, indicating list view is active
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to List View
    const listViewShot = path.join(screenshotsDir, 'step_2_list_view.png');
    await page.screenshot({ path: listViewShot });
    screenshots.push(listViewShot);

    // Extract some data to verify List View is active
    // For example, count the number of .product-card-list elements
    const productCount = await page.$$eval('.products-list .product-card-list', els => els.length);

    return {
      success: true,
      action: "Switched to List View Mode using the List View toggle button",
      extractedData: {
        listViewActive: true,
        productCardListCount: productCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
